import React, {useState} from "react";


function App() {
  const [like, setLike]  = useState(0)



  return (
    <div className="App">
      <h1>{like}</h1>
      <button onClick={() => setLike +=1 }> Increment </button>
      <button onClick={() => setLike -=1 }> Decrement </button>
    </div>
  );
}

export default App;
